$(function() {
  var cityName,places,polygon,regionName;

  var regionSelect = $('#region');
  var citySelect = $('#city');
  var agencies = $('.agencies');
  var agenciesList = $('.agencies__list');

  // Zoom level to fit whole country/city on mobile
  zoomCountry = ($(window).width() < 1000 ) ? (($(window).width() - 320)*0.002352941) + 5.2 : 6.5;
  zoomCity = ($(window).width() < 1000 ) ? 2 : 0;

  var map = L.map('map__box--1').setView([52.0688122, 19.4797444], zoomCountry);

	L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
		maxZoom: 18,
		attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors',
		id: 'mapbox.streets'
	}).addTo(map);

  $.getJSON("https://api.myjson.com/bins/j24qq", function(data) {
		places = data;
		
		Object.keys(places).forEach(function(prop) {
			var cities = places[prop].cities;
			var prevProp = prop;
			
			Object.keys(cities).forEach(function(prop) {
				if (places[prevProp].cities[prop].places) {
					places[prevProp].cities[prop].places.forEach(function(place) {

						var infoPopup = `
						<div class='info'>
							<p class='info__name'>${place.name}</p>
							<p class='info__adress'>${place.adress}</p>
							<p class="info__phone">${place.phone.join(', ')}</p>
						</div>
					`;

						L.marker([place.location[0], place.location[1]]).bindPopup(infoPopup).addTo(map);
					});
				}
			});
		});
  });
  
  regionSelect.change(function() {
    var points = [];
    var region = regions[$(this).val()];
    regionName = $(this).val();

    // Find cities
    // Clear
    citySelect.html('<option value="">-- wybierz miasto --</option>');

    // New choose
    var cities = places[regionName].cities;
    Object.keys(cities).map(city => {
      $('<option/>').text(city).val(city).appendTo("#city");
    })

    // Build border polygon for region
    for (var i = 0; i < region.length; i += 2) {
      points.push([region[i + 1], region[i]]);
    }

    if (!polygon) {
      // map.removeLayer(polygon);
      polygon = L.polygon(points, {color: 'red'}).addTo(map);
    } else {
      map.removeLayer(polygon);
      polygon = L.polygon(points, {color: 'red'}).addTo(map);
    }
      map.fitBounds(polygon.getBounds());
	});
	
    // Select city
    citySelect.change(function() {
      if (!agencies.hasClass('active')) {
        agencies.addClass('active');
      }

      cityName = $(this).val();
      var currCity = places[regionName].cities[cityName];
      map.setView([currCity.location[0],currCity.location[1]],currCity.zoom - zoomCity);

      agenciesList.html('');
      currCity.places.forEach(item => {
        var agency = $('<div>').addClass('agencies__item');
        var agencyName = $(`<p>${item.name}</p>`).addClass('agencies__name');
        var agencyAdress = $(`<p>${item.adress}</p>`).addClass('agencies__adress');
        var agencyPhoneBox = $('<div>').addClass('agencies__phone-box');
        
        item.phone.forEach(item => {
          var agencyPhone = $(`<p>${item}</p>`).addClass('agencies__phone');
          agencyPhoneBox.append(agencyPhone);
        });
        
        agency.append(agencyName,agencyAdress,agencyPhoneBox);
        agenciesList.append(agency);
      });
		});
})